import React from "react";
import LoginPage from "./pages/LoginPage";
import LanguageSelector from "./components/LanguageSelector";
import ApiProgress from "./shared/ApiProgress";

function App() {
  return (
    <div className="row">
<div className="col">
      <React.StrictMode>
        <LanguageSelector />
        <ApiProgress>
          <LoginPage />
        </ApiProgress>
      </React.StrictMode>
    </div>
    </div>

  );
}

export default App;
